import { Button, Card, Grid, Typography } from '@mui/material';

export default function Inicio() {
  return(
      <Grid container direction='column' alignItems='center' justifyContent='center'>
        <Grid item xs={3}>
          <Card></Card>
        </Grid>

      </Grid>
  )
}
